import '../indexContain/IndexContain.css';
import PeopleImg from '../indexContain/people-index.png';


function IndexContain() {
    return(
        <div className='container-index'>
            <div className='invite-information'>

            </div>
           
            <img className='image-index' alt='people doing exercise' src={PeopleImg}></img>
            

        </div>
    )
}

export default IndexContain;
